import React from "react";
import Typewriter from "typewriter-effect";
import '../new.css';

function Type() {
  return (
    <Typewriter
      options={{
        strings: [
            <strong>  "Fronted React Developer" </strong>
        
        ],
        autoStart: true,
        loop: true,
        deleteSpeed: 50,
      }}
    />
  );
}

export default Type;
